Text:
Måste hålla med "Dendryge" om att nedladdningshastighten är rejält seg på de flesta torrents. Brukar själv endast få en download på 10-15 Kbits/sek, och sen samtidigt ha en upload på 80-90 Kbits/sek. Känns lite tråkigt. När jag har laddat hem de 4,3 Gb färdigt så har jag redan laddat upp de fyrdubbla.

Ironiskt nog så har jag enligt "statistiken" endast laddat upp runt 100 Gb....sanningen ligger förmodligen på 1000 Gb minst. 

// MrSandman
